import { configureStore } from '@reduxjs/toolkit';
import addToCartReducer from '../redux/addToCart';
import cartReducer from '../';

export const store = configureStore({
  reducer: {
    addtocart: addToCartReducer,
    cart: cartReducer
  },
});
